Config.db_i18n [11726]  = {zh-cn= [[传承数千年的预言之书，传说它是东方古国皇帝为推算国运，命令术士李淳风和袁天罡上穷碧落，下尽黄泉所得，刻于龟背之上，推演宇宙万灵湮灭与重生轨迹。]] , zh-hk= [[傳承數千年的預言之書，傳說它是東方古國皇帝為推算國運，命令術士李淳風和袁天罡上窮碧落，下盡黃泉所得，刻於龜背之上，推演宇宙萬靈湮滅與重生軌跡。]] , thai= [[]] , en= [[The book of prophecy that succeeded though generations. It's said that the ancient emperor commanded the great warlocks to retain this book so the fate of the universe can be learned.]] }
