Config.db_i18n [11728]  = {zh-cn= [[永恒之枪昆古尼尔，主神奥丁之神器，相传奥丁将其抛过华纳神族头顶，开启了阿萨神族与华纳神族之战争。]] , zh-hk= [[永恆之槍昆古尼爾，主神奧丁之神器，相傳奧丁將其拋過華納神族頭頂，開啟了阿薩神族與華納神族之戰爭。]] , thai= [[]] , en= [[Gungnir, the Lance of Eternity - the artifact of Odyn - the war between Atha and Wanar begins when he throws this lance over the sky above Wanar's territory.]] }
Config.db_i18n [11729]  = {zh-cn= [[“掷出必定命中，划破天际宛如流星。”]] , zh-hk= [[“擲出必定命中，劃破天際宛如流星。”]] , thai= [[]] , en= [[“It breaks the sky like a meteor and it never misses. ”]] }
Config.db_i18n [11730]  = {zh-cn= [[在人类堕落以先，大天使路西法心生骄慢，率领天使反叛，结果被打落到了地上，成为“空中属灵气的魔鬼”，又称“撒旦”。路西法的羽翼亦被帝神剥夺，掉落神坛。]] , zh-hk= [[在人類墮落以先，大天使路西法心生驕慢，率領天使反叛，結果被打落到了地上，成為“空中屬靈氣的魔鬼”，又稱“撒旦”。路西法的羽翼亦被帝神剝奪，掉落神壇。]] , thai= [[]] , en= [[Before the human beings fall, Lucifer, the Archangel resisted - yet his decease in the war made him the Satan. His wings were therefore taken by the God.]] }
Config.db_i18n [11731]  = {zh-cn= [[知识，奥秘，法术，以及神秘之物的主宰诺甘农的十字权杖。神秘的泰坦，在他创造的世界中，将此权杖作为自己咒术的载体，并在施法时轻呼一个温柔的名字，名字的主人，无人知晓。]] , zh-hk= [[知識，奧秘，法術，以及神秘之物的主宰諾甘農的十字權杖。神秘的泰坦，在他創造的世界中，將此權杖作為自己咒術的載體，並在施法時輕呼一個溫柔的名字，名字的主人，無人知曉。]] , thai= [[]] , en= [[Knowledge, secrets and spells - altogether with the crux sceptre of Norgannon. This mystic item is the body of the Titan's curse in the real world, though nobody knows the name, the Titan whispers when channeling the spell.]] }
Config.db_i18n [11732]  = {zh-cn= [[米德加尔特远古战狼的印记，躁动易怒，集群效果显著，叠加使用威力巨大，战斗力媲美帝国军的粉红导弹，令人闻风丧胆。]] , zh-hk= [[米德加爾特遠古戰狼的印記，躁動易怒，集群效果顯著，疊加使用威力巨大，戰鬥力媲美帝國軍的粉紅導彈，令人聞風喪膽。]] , thai= [[]] , en= [[This seal symbolizes the ancient wolves of Midgart and it can be powerful when stacked.]] }
Config.db_i18n [11733]  = {zh-cn= [[凤凰座圣衣中蕴涵着不死身和无限进化的能力，传说记载，它所传承的不死鸟一辉的生命力，能靠拥有者的力量再度浴火重生。]] , zh-hk= [[鳳凰座聖衣中蘊涵著不死身和無限進化的能力，傳說記載，它所傳承的不死鳥一輝的生命力，能靠擁有者的力量再度浴火重生。]] , thai= [[]] , en= [[The cloak of the phoenix contains immortality and the ability of infinite evolution. According to legend, the vitality of the immortal bird can be reborn by the power of its owner.]] }
Config.db_i18n [11734]  = {zh-cn= [[那罗辛哈狮王遗落的长牙，拾获之人须悉心盘养，虔诚供奉，方可得到大神毗湿奴的祝福。]] , zh-hk= [[那羅辛哈獅王遺落的長牙，拾獲之人須悉心盤養，虔誠供奉，方可得到大神毗濕奴的祝福。]] , thai= [[]] , en= [[The long teeth left by the Lion King Rosinha must be carefully cultivated and devoted to receive the blessing of the great god Vishnu.]] }
