Config.db_i18n [11736]  = {zh-cn= [[多年以前G30帝国秘密武装于肯特沙城隐蔽洞窟训练的特种卫队，盗用古龙遗骸之血强行制造出的龙鳞铁鹰变异物种，随帝国消亡而一同隐匿。]] , zh-hk= [[多年以前G30帝國秘密武裝於肯特沙城隱蔽洞窟訓練的特種衛隊，盜用古龍遺骸之血強行製造出的龍鱗鐵鷹變異物種，隨帝國消亡而一同隱匿。]] , thai= [[]] , en= [[Many years ago, the G30 empire secretly armed the special guards trained in the hidden caves of Kent Sands, stealing the dragon scale iron hawk mutant species forcibly created by using the blood of the ancient dragon remains, and hiding with the demise of the empire.]] }
