Config.db_i18n [11739]  = {zh-cn= [[炼金鬼才特立斯梅吉士特斯与占星术士乌拉妮娅的凄美爱情遗物，记载着纠缠的爱恨情仇毁灭的瞬间。]] , zh-hk= [[煉金鬼才特立斯梅吉士特斯與占星術士烏拉妮婭的淒美愛情遺物，記載著糾纏的愛恨情仇毀滅的瞬間。]] , thai= [[]] , en= [[The beautiful love relics of the alchemist Triss Megistus and the astrologer Urania record the moment of entanglement of love and hatred.]] }
