Config.db_i18n [11741]  = {zh-cn= [[东方古树毕钵罗树，迦毗罗卫国王子乔达摩·悉达多为摆脱生老病死轮回之苦，解救苦难众生，放弃王族生活出家修行，在此树下战胜了邪恶诱惑，在启明星升起的时候，获得大彻大悟，修炼成佛陀。]] , zh-hk= [[東方古樹畢缽羅樹，迦毗羅衛國王子喬達摩·悉達多為擺脫生老病死輪回之苦，解救苦難眾生，放棄王族生活出家修行，在此樹下戰勝了邪惡誘惑，在啟明星升起的時候，獲得大徹大悟，修煉成佛陀。]] , thai= [[]] , en= [[The ancient oriental tree Pippala, the prince of Kapila, Siddhartha Gautama, in order to get rid of the sufferings of rebirth of old age, sickness, and death, he gave up royal life and practiced as a monk. He defeated the evil temptation under this tree - at that time, he gained great insight and practiced as a Buddha.]] }
Config.db_i18n [11742]  = {zh-cn= [[佛祖和牛顿共同曰：“大树底下好乘凉”]] , zh-hk= [[佛祖和牛頓共同曰：“大樹底下好乘涼”]] , thai= [[]] , en= [[Both the Buddha and Newton said: "Great trees are good for shade."]] }
Config.db_i18n [11743]  = {zh-cn= [[泰坦诸神之普罗米修斯，自太阳神阿波罗处盗取的火种。人类福祉与力量的根源。]] , zh-hk= [[泰坦諸神之普羅米修斯，自太陽神阿波羅處盜取的火種。人類福祉與力量的根源。]] , thai= [[]] , en= [[The tinder stolen from the sun god Apollo by Prometheus, the god of the Titans. The source of human power and well-beings.]] }
Config.db_i18n [11744]  = {zh-cn= [[墨里亚森林曾经被三头巨兽Chimera盘踞占领，为了将它打败，暗夜精灵们将古树的意志淬炼在月亮井水中，制成穿透韧甲的神弓。]] , zh-hk= [[墨裏亞森林曾經被三頭巨獸Chimera盤踞佔領，為了將它打敗，暗夜精靈們將古樹的意志淬煉在月亮井水中，製成穿透韌甲的神弓。]] , thai= [[]] , en= [[The Moria forest was once occupied by the three-headed monster Chimera. In order to defeat it, the night elves tempered the will of the ancient tree in the moon well water to make a powerful bow that penetrates the formidable armor.]] }
