Config.db_i18n [11746]  = {zh-cn= [[神墓，即埋葬诸神的地方，当然不是猫猫狗狗生前都能叫作神，这件铠甲采用陨铁打造，主人本是大名鼎鼎的双生骷髅王悉提帕提，表面温度高达1500℃，要三思哦！]] , zh-hk= [[神墓，即埋葬諸神的地方，當然不是貓貓狗狗生前都能叫作神，這件鎧甲採用隕鐵打造，主人本是大名鼎鼎的雙生骷髏王悉提帕提，表面溫度高達1500℃，要三思哦！]] , thai= [[]] , en= [[This tomb is the place where gods are buried, and it's no generic tomb - put on this meteorite armor, once owned by the Skeleton Lord and it's scorching hot - think twice before putting it on!]] }
Config.db_i18n [11747]  = {zh-cn= [[维京海贼南下攻城掠地，所向披靡，人手一把闪着靡靡之光的盾牌，据说涂抹了恶魔大蛇勒耳那的“黑金”，方圆百米弥漫着一言难尽的味道。]] , zh-hk= [[維京海賊南下攻城掠地，所向披靡，人手一把閃著靡靡之光的盾牌，據說塗抹了惡魔大蛇勒耳那的“黑金”，方圓百米彌漫著一言難盡的味道。]] , thai= [[]] , en= [[The Viking Pirates smashed south and swept the city. They were invincible, and their shields were flashing with extravagant light. It is said that the "black gold" of the demon serpent Lerna was smeared on their shield.]] }
