Config.db_i18n [11749]  = {zh-cn= [[地精族是盖亚大陆自古以来最神秘的工匠，精灵神族的羽毛散落盖亚大陆，被心灵手巧的地精匠人打造成为传奇的羽刃。]] , zh-hk= [[地精族是蓋亞大陸自古以來最神秘的工匠，精靈神族的羽毛散落蓋亞大陸，被心靈手巧的地精匠人打造成為傳奇的羽刃。]] , thai= [[]] , en= [[The Goblins are the most mysterious artisans of Gaia since ancient times. The feathers of the Elven Gods are scattered on Gaia and they were forged into powerful blades by the goblins.]] }
